import React from 'react';
import { useLanguage } from '../Store/LanguageContext';
import logo from '../Components/lo.png';
import { useNavigate, useLocation } from 'react-router-dom';

const titles = {
  "/":        { ar: "الرئيسية",           en: "Home" },
  "/admin/login":     { ar: "المصرحين",         en: "Admin" },
  "/admin/add-event": { ar: "إضافة فعالية",      en: "Add Event" },
  "/admin/feedback":  { ar: "تقييمات الفعاليات", en: "Event Feedback" },
  "/event-feedback":  { ar: "ملاحظات الفعالية",  en: "Event Feedback" },
};

const Header = () => {
  const { lang, setLang } = useLanguage();
  const navigate = useNavigate();
  const location = useLocation();
  const isRTL = lang === "ar";

  // يعود true لو المسار الحالي مطابق للرابط
  const isActive = (pathname) => location.pathname === pathname;

  // تغيير اللغة
  const toggleLang = () => setLang(lang === 'en' ? 'ar' : 'en');

  // عنوان الصفحة الحالي
  const pageTitle =
    titles[location.pathname]
      ? titles[location.pathname][lang]
      : (lang === "ar" ? "..." : "...");

  return (
    <header
      style={{
        position: 'fixed',
        top: 0, left: 0, width: '100%',
        zIndex: 10000,
        backdropFilter: 'blur(8px) saturate(150%)',
        WebkitBackdropFilter: 'blur(8px) saturate(150%)',
        background: 'rgba(255,255,255,0.0)',
        borderBottom: '1.7px solid #ece2c6',
        boxShadow: '0 2px 18px 0 rgba(199, 182, 148, 0.07)',
        minHeight: 76,
        display: 'flex',
        flexDirection: isRTL ? "row-reverse" : "row",
        alignItems: 'center',
        justifyContent: 'space-between',
        padding: '0 0.2vw',
        fontFamily: 'Tajawal, Cairo, Roboto, Arial, sans-serif',
        transition: "background 0.25s"
      }}
    >
      {/* الشعار */}
      <div
        style={{
          display: 'flex', alignItems: 'center',
          cursor: "pointer",
          minWidth: 110,
        }}
        onClick={() => navigate("/")}
        tabIndex={0}
        aria-label="Home Page"
      >
        <img
          src={logo}
          alt="Engineering Village Logo"
          style={{
            height: 41,
            width: "auto",
            filter: "drop-shadow(0 1px 2px #d4af6e34)",
            transition: "transform 0.18s",
          }}
          onMouseOver={e=>e.currentTarget.style.transform="scale(1.07)"}
          onMouseOut ={e=>e.currentTarget.style.transform="scale(1)"}
        />
      </div>

      {/* عنوان الصفحة وسط الهيدر */}
      <div
        style={{
          textAlign: 'center', width: '100%',
          position: 'absolute', left: 0, right: 0,
          margin: 'auto', pointerEvents: 'none',
        }}
      >
        <span
          style={{
            fontWeight: 900,
            fontSize: "1.31rem",
            color: "#2B1d09",
            letterSpacing: "0.11px",
            textShadow: "0 2px 12px #fff7c50c",
            fontFamily: "inherit",
            userSelect: "none",
            display: "inline-block",
          }}
        >
          {pageTitle}
        </span>
      </div>

      {/* Tabs group */}
      <nav style={{
        display: 'flex',
        alignItems: 'center',
        gap: '0.7rem',
        minWidth: 180,
        justifyContent: isRTL ? "flex-start" : "flex-end"
      }}>
        <NavTab
          active={isActive("/admin/login")}
          label={lang === "ar" ? "المصرحين" : "Admin"}
          onClick={() => navigate('/admin/login')}
        />
        <NavTab
          active={false}
          label={lang === "ar" ? 'عربي' : 'English'}
          onClick={toggleLang}
        />
      </nav>
    </header>
  );
};

// مكون تاب (رابط صفحة نصي بشكل عالمي)
function NavTab({ label, active, onClick }) {
  return (
    <button
      type="button"
      onClick={onClick}
      tabIndex={0}
      style={{
        background: "none",
        border: "none",
        outline: "none",
        color: active ? "#77501c" : "#574b32",
        fontWeight: active ? 900 : 700,
        fontSize: "1.09rem",
        padding: "0.36rem 1.12rem",
        borderRadius: 24,
        transition: "background 0.14s,color 0.17s",
        backgroundColor: active ? "rgba(220,209,175,0.23)" : "transparent",
        cursor: "pointer",
        boxShadow: active ? "0 1px 8px #ebe6c6b1" : "none",
        // تأثير hover
      }}
      onMouseOver={e => {
        e.currentTarget.style.backgroundColor = "rgba(224,202,157,0.16)";
        e.currentTarget.style.color = "#532c09";
      }}
      onMouseOut={e => {
        e.currentTarget.style.backgroundColor = active
          ? "rgba(220,209,175,0.23)"
          : "transparent";
        e.currentTarget.style.color = active ? "#77501c" : "#574b32";
      }}
    >
      {label}
    </button>
  );
}

export default Header;
